// components/Skills.js

import React from 'react';
import styles from './styles/Skills.module.css';
import { motion } from 'framer-motion';

function Skills() {
  return (
    <motion.div
    className={styles.home} // Add the CSS module class here
    initial={{ opacity: 0 }}
    animate={{ opacity: 1 }}
    exit={{ opacity: 0 }}
    transition={{ duration: 1 }}
>
    <div className={styles.container}>
      <h2 className={styles.header}>Skills</h2>
      <p className={styles.description}><b>Languages: </b> 
      <ul>
        <li>Java</li>
         <li>C/C++</li>
           <li>JavaScript</li>
           <li> HTML</li>
           <li> CSS</li>
            <li>Python</li> 
            <li>React Js</li>
             <li>Node Js </li>
             <li>SQL</li>
             <li>Mongo DB</li> 
             <ul></ul>
             Operating Systems: Kali Linux, Windows, Android, Ubuntu</ul></p>
      <p className={styles.description}><b>Tools: </b> Nmap, Wireshark, Psql </p>
      <p className={styles.description}><b>Software: </b> Android Studio, Visual Studio, Anaconda, Sublime, PgAdmin
</p>
    </div>
    </motion.div>
  );
}

export default Skills;
